import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
function MyInfo(){
  return (
    <div>
      <h1>Ashutosh Singh</h1>
      <p>I am learning React</p>
      <ul>
        <li>Goa</li>
        <li>Kashmir</li>
        <li>Home</li>
      </ul>
    </div>
  )
}

ReactDOM.render(<MyInfo />, document.getElementById('root'))
